import React, { Component } from 'react';
import styles from './home.module.scss';

export default class Welcome extends Component {
  render() {
    return(
      <div className={styles.bg}>
      <section>
        <h2>Engage your Audience</h2>
      </section>
      </div>
    );
  }
}
